INSERT INTO `libros` (`lib_id`, `titulo`, `orig_titulo`, `isbn`, `paginas`, `descripcion_fisica`, `descripcion`, `genero_id`, `editorial_id`, `created_at`, `updated_at`) VALUES(1, 'Moby-Dick', 'Moby-Dick', 9787532226320, 581, 'Bolsillo', 'Narra la travesía del barco ballenero Pequod, \r\ncomandado por el capitán Ahab, junto a Ismael y el \r\narponero Quiqueg en la obsesiva y autodestructiva \r\npersecución de un gran cachalote blanco.', 1, 1, '2019-04-20 01:59:17', NULL);
INSERT INTO `libros` (`lib_id`, `titulo`, `orig_titulo`, `isbn`, `paginas`, `descripcion_fisica`, `descripcion`, `genero_id`, `editorial_id`, `created_at`, `updated_at`) VALUES(2, 'Yo, robot', 'I Robot', 9780007491513, 374, 'No.id', 'Yo, robot es una colección de relatos en los que se \r\nestablecen y plantean los problemas de las tres leyes \r\nde la robótica que son un compendio fijo e imprescindible \r\nde moral aplicable a supuestos robots inteligentes.', 2, 2, '2019-04-20 01:59:17', NULL);
INSERT INTO `libros` (`lib_id`, `titulo`, `orig_titulo`, `isbn`, `paginas`, `descripcion_fisica`, `descripcion`, `genero_id`, `editorial_id`, `created_at`, `updated_at`) VALUES(3, 'La isla misteriosa', 'The mysterious island', 9788497862752, 476, 'Portada blanda', 'Durante la guerra civil americana, cinco hombres logran escapar del asedio de Richmond en un globo aerostático que finalmente acabará estrellándose en una isla desierta de los Mares del Sur. Los cinco compañeros no tienen nada salvo su ingenio para sobrev', 3, 3, '2019-04-20 01:59:17', NULL);
INSERT INTO `libros` (`lib_id`, `titulo`, `orig_titulo`, `isbn`, `paginas`, `descripcion_fisica`, `descripcion`, `genero_id`, `editorial_id`, `created_at`, `updated_at`) VALUES(11, 'Amanecer rojo', 'Red rising', 9785040790166, 382, 'Portada blanda', 'Ahora, en Marte, el equilibrio se sustenta en un férreo sistema de castas representadas por colores. Para acceder a la élite de los gobernantes, los dorados deben ganarse su puesto en una contienda implacable.', 2, 2, '2019-04-20 23:42:38', NULL);
INSERT INTO `libros` (`lib_id`, `titulo`, `orig_titulo`, `isbn`, `paginas`, `descripcion_fisica`, `descripcion`, `genero_id`, `editorial_id`, `created_at`, `updated_at`) VALUES(12, 'Fundación', 'Foundation', 9788498003116, 230, 'Portada dura', 'Una de las características más interesantes de la novela es que se trata de un futuro muy lejano, decenas de miles de años en el futuro pero con condiciones netamente humanas. ', 2, 1, '2019-04-20 22:08:36', NULL);
INSERT INTO `libros` (`lib_id`, `titulo`, `orig_titulo`, `isbn`, `paginas`, `descripcion_fisica`, `descripcion`, `genero_id`, `editorial_id`, `created_at`, `updated_at`) VALUES(14, 'Hijo dorado', 'Golden son', 9788427208773, 464, 'Portada blanda', 'Tras una implacable competición en el Instituto de Marte, Darrow se ha ganado un puesto de honor entre la élite gobernante. Ahora luce la cicatriz curvada de los dorados, los más crueles y brillantes de los humanos. Pero Darrow no es como ellos…', 2, 1, '2019-04-21 17:29:08', NULL);
